INSERT INTO convocatoria VALUES (4, 'PROCODAS', 'La Convocatoria estuvo orientada a apoyar Proyectos de TecnologÃÂ­as para la InclusiÃÂ³n Social (PTIS), que tengan como objeto la resoluciÃÂ³n y/o la mejora, a travÃÂ©s de un desarrollo tecnolÃÂ³gico especÃÂ­fico, de la calidad de vida de las comunidades en las que se hayan detectado necesidades.
 
