Agricultura Familiar: Comprende los proyectos que suponen una innovaciÃÂ³n o realizan una mejora productiva en unidades agropecuarias familiares, pequeÃÂ±as empresas, cooperativas o entidades que las contengan, ya sea en las tÃÂ©cnicas de producciÃÂ³n, de organizaciÃÂ³n y/o comercializaciÃÂ³n, y el acceso al uso de agua y la energÃÂ­a renovable aplicados a la producciÃÂ³n; privilegiando aquellos proyectos que planteen la adecuaciÃÂ³n y/o desarrollo de maquinaria agrÃÂ­cola a pequeÃÂ±as unidades agropecuarias familiares. Se fomentarÃÂ¡n las iniciativas en los sectores de agricultura, ganaderÃÂ­a, pesca, o silvicultura cuyo impacto incremente el valor agregado del producto, las condiciones sociales de producciÃÂ³n y la inserciÃÂ³n de los productores como proveedores de las cadenas de suministros sectoriales y/o territoriales.

HÃÂ¡bitat Social: Los proyectos deberÃÂ¡n orientarse a la mejora del hÃÂ¡bitat con ÃÂ©nfasis en sus dimensiones sociales. PromoverÃÂ¡ el desarrollo de tecnologÃÂ­as que mejoran la calidad de vida, ya sea en la esfera domÃÂ©stica, en las viviendas, en los espacios pÃÂºblicos y comunitarios. Se privilegiarÃÂ¡n las acciones que impliquen el uso de recursos locales, la innovaciÃÂ³n en materiales y sistemas constructivos y la resoluciÃÂ³n de problemÃÂ¡ticas relevantes en los asentamientos y villas. (p.ej.: captaciÃÂ³n y potabilizaciÃÂ³n de agua, manejo de residuos sÃÂ³lidos y lÃÂ­quidos, uso racional de la energÃÂ­a, seguridad ciudadana, entre otros). Fortaleciendo a su vez el tejido de la organizaciÃÂ³n social comunitaria.
Las propuestas deben fomentar procesos endÃÂ³genos de desarrollo social y econÃÂ³mico con respaldo y participaciÃÂ³n locales y que, mediante la coordinaciÃÂ³n de amplios actores territoriales, se orienten a fortalecer su tejido social y comunitario para el logro de impactos sustentables en el tiempo.
 
Entidades solicitantes: 

